// src/components/Dashboard.js
import React from "react";
import { useNavigate } from "react-router-dom";
import { FaHeartbeat, FaBone, FaBrain, FaPhone, FaHospital } from "react-icons/fa";
import { MdTipsAndUpdates } from "react-icons/md";

const Dashboard = () => {
  const navigate = useNavigate();

  const exerciseCards = [
    {
      title: "Cardiac Rehab",
      subtitle: "Cardiac Condition",
      description: "Improve your heart health with guided exercises.",
      icon: <FaHeartbeat size={36} className="text-red-500" />,
      label: "Heart Health",
      labelColor: "bg-yellow-400 text-black",
      button: "Start",
      link: "/exercise/cardiac",
    },
    {
      title: "Orthopedic Rehab",
      subtitle: "Joint Recovery",
      description: "Rebuild strength after orthopedic procedures.",
      icon: <FaBone size={36} className="text-blue-600" />,
      label: "Joint Recovery",
      labelColor: "bg-yellow-400 text-black",
      button: "Start",
      link: "/exercise/ortho",
    },
    {
      title: "Neuro Rehab",
      subtitle: "Neurological Recovery",
      description: "Support neuroplasticity through movement.",
      icon: <FaBrain size={36} className="text-purple-600" />,
      label: "Neurological Recovery",
      labelColor: "bg-yellow-400 text-black",
      button: "Start",
      link: "/exercise/neuro",
    },
    {
      title: "Physiotherapy",
      subtitle: "Full-body Mobility",
      description: "Maintain flexibility and functional movement.",
      icon: <MdTipsAndUpdates size={36} className="text-green-600" />,
      label: "Mobility Tips",
      labelColor: "bg-yellow-400 text-black",
      button: "Start",
      link: "/exercise/physio",
    },
    {
      title: "Contact Us",
      subtitle: "We care about you",
      description: "Reach out to our rehab experts anytime.",
      icon: <FaPhone size={36} className="text-orange-500" />,
      label: "Support",
      labelColor: "bg-yellow-400 text-black",
      button: "Know More",
      link: "/contact",
    },
    {
      title: "Best Rehab Center",
      subtitle: "Find Near You",
      description: "Discover top-rated rehab centers nearby.",
      icon: <FaHospital size={36} className="text-pink-500" />,
      label: "Nearby Help",
      labelColor: "bg-yellow-400 text-black",
      button: "Find",
      link: "/centers",
    },
  ];

  return (
    <div className="min-h-screen bg-gray-100 font-sans">
      <header className="bg-blue-800 text-white py-5 px-8 shadow">
        <h1 className="text-2xl font-bold">AI Rehab Dashboard</h1>
      </header>

      <main className="p-6 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-3 gap-6">
        {exerciseCards.map((card, index) => (
          <div
            key={index}
            className="bg-white p-6 rounded-xl shadow-md hover:shadow-xl transition-transform transform hover:scale-105 flex flex-col justify-between"
          >
            <div className="flex items-center gap-3 mb-2">
              {card.icon}
              <h2 className="text-xl font-semibold text-gray-800">{card.title}</h2>
            </div>
            <p className="text-sm font-medium text-gray-700 italic">{card.subtitle}</p>
            <span className={`inline-block mt-2 mb-4 text-xs font-semibold px-3 py-1 rounded-full ${card.labelColor}`}>
              {card.label}
            </span>
            <p className="text-gray-700 text-sm flex-grow">{card.description}</p>
            <button
              onClick={() => navigate(card.link)}
              className="mt-4 bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded-md font-semibold transition"
            >
              {card.button}
            </button>
          </div>
        ))}
      </main>
    </div>
  );
};

export default Dashboard;
